import styled from '../../utils/styled';

const Page = styled('div')`
    position: absolute;
    top: 60px;
    left: 198px;
    width: 100%;
    height: 100%;
    display: flex;
    flex-direction: row;
    flex: 1 1 auto;
    padding: ${props => props.theme.containerPadding};
`;

export default Page;
